  let t = U.timeSec * 0.35 + p.seed * 10.0;
  let n = vec2<f32>(
    noise2(p.pos * 0.01 + vec2<f32>(t, 0.0)),
    noise2(p.pos * 0.01 + vec2<f32>(0.0, t))
  ) - vec2<f32>(0.5);
  acc += n * mix(0.05, 0.45, U.gpuUtil01);

  // --- Integrate ---
  let dt = U.dtSec;
  p.vel = p.vel + acc * dt;

